    arr_fixture_api_football = []
    for x in fixture_json:
        
        row = {}
        row['id_fixture'] = x['fixture']['id']
        row['comment'] = ''
        row['footballfield'] = x['fixture']['venue']['name']
        row['tournament_name'] = x['league']['name']
        row['tournament_id'] = x['league']['id']
        row['tournament_friendly'] = False
        row['playered'] = True if x['fixture']['status']['long'] == 'Match Finished' else False
        row['signature_1'] = ""
        row['signature_2'] = ""
        row['team_1_goal'] = x['goals']['home'] if x['goals']['home'] != None else 0
        row['team_2_goal'] = x['goals']['away'] if x['goals']['away'] != None else 0
        row['referee_image'] = ''
        row['date_played'] = x['fixture']['date']
        row['phase'] = x['league']['round']
        row['team_1_id'] =x['teams']['home']['id']
        row['team_1_name'] = x['teams']['home']['name']
        row['team_1_avatar'] = x['teams']['home']['logo']
        row['team_1_goals'] = x['goals']['home'] if x['goals']['home'] != None else 0
        row['team_2_id'] =x['teams']['away']['id']
        row['team_2_name'] = x['teams']['away']['name']
        row['team_2_avatar'] = x['teams']['away']['logo']
        row['team_2_goals'] = x['goals']['away'] if x['goals']['away'] != None else 0
        row['type'] = 'match'
        row['origin'] ='https://api-football-v1.p.rapidapi.com/v3/'
        row['season'] = x['league']['season']
        arr_fixture_api_football.append(row)

    
